import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Schneider Truck</h1>
      </header>
      <nav>
        <button>Enter Your Destination</button>
        <button>Report Time</button>
        <button>Weather Today</button>
      </nav>
      <main>
        <section>
          <h2>About Us</h2>
          {/* Content about the company */}
        </section>
        <section>
          <h2>Community Tips</h2>
          {/* Community tips content */}
        </section>
        <section>
          <h2>Driving Summary</h2>
          {/* Driving summary content */}
        </section>
      </main>
      <footer>
        {/* Footer content */}
      </footer>
    </div>
  );
}

export default App;
